// src/components/Footer/footer.styles.js

const styles = {
  footer: {
    backgroundColor: '#f5f5f5',
    py: 4,
    mt: 8,
    borderTop: '1px solid #ddd',
  },
  container: {
    textAlign: 'center',
  },
  credit: {
    mt: 1,
    display: 'block',
  },
};

export default styles;
